import { useSelector } from "react-redux";
import { useNavigate } from "react-router-dom"; // ✅ For navigation
import { useState } from "react";
import {
  Container, Row, Col, Button, Input, Nav, NavItem, NavLink, FormGroup, Label, Form
} from "reactstrap";


const Home = () => {
  const email = useSelector((state) => state.users.user.email);
  const navigate = useNavigate();

  const [salary, setSalary] = useState("");
  const [electricity, setElectricity] = useState("");
  const [water, setWater] = useState("");
  const [household, setHousehold] = useState("");
  const [personal, setPersonal] = useState("");

  const handleSave = (e) => {
    e.preventDefault();

    const totalExpenses = Number(electricity) + Number(water) + Number(household) + Number(personal);
    const remaining = Number(salary) - totalExpenses;

    // 🌟 Navigate to SavingsForm and pass the data
    navigate("/savings", {
      state: {
        salary,
        electricity,
        water,
        household,
        personal,
        totalExpenses,
        remaining,
      },
    });
  };

  const handleLike = () => {
    alert("You liked this form! ❤️");
  };

  return (
    <Container fluid className="mt-4">
      <Row>
        <Col md={3} className="sidebar bg-dark text-white">
          <h4 className="p-3 border-bottom">Home Budget App</h4>
          <Nav vertical pills className="flex-column px-3">
            <NavItem><NavLink href="#profile" className="text-white">Profile</NavLink></NavItem>
            <NavItem><NavLink href="#location" className="text-white">Location</NavLink></NavItem>
            <NavItem><NavLink href="#update-profile" className="text-white">Update Profile</NavLink></NavItem>
            <NavItem><NavLink href="#feedback" className="text-white">Feedback</NavLink></NavItem>
            <NavItem><NavLink href="#logout" className="text-white">Logout</NavLink></NavItem>
          </Nav>
        </Col>

        {/* 🌟 Form */}
        <Col md={9} className="main-content">
          <h2 className="mb-4">Monthly Budget Form</h2>
          <Form onSubmit={handleSave}>
            <FormGroup><Label for="salary">Monthly Salary</Label><Input type="number" id="salary" value={salary} onChange={(e) => setSalary(e.target.value)} required /></FormGroup>
            <FormGroup><Label for="electricity">Electricity Bill</Label><Input type="number" id="electricity" value={electricity} onChange={(e) => setElectricity(e.target.value)} required /></FormGroup>
            <FormGroup><Label for="water">Water Bill</Label><Input type="number" id="water" value={water} onChange={(e) => setWater(e.target.value)} required /></FormGroup>
            <FormGroup><Label for="household">Household Expenses</Label><Input type="number" id="household" value={household} onChange={(e) => setHousehold(e.target.value)} required /></FormGroup>
            <FormGroup><Label for="personal">Personal Use</Label><Input type="number" id="personal" value={personal} onChange={(e) => setPersonal(e.target.value)} required /></FormGroup>

            <Row>
              <Col md={6}>
                <Button color="success" type="submit" block onc>Save</Button>
              </Col>
              <Col md={6}>
                <Button color="danger" type="button" block onClick={handleLike}>❤️ Like</Button>
              </Col>
            </Row>
          </Form>
        </Col>
      </Row>
    </Container>
  );
};

export default Home;
